
CREATE TABLE VendorInformationRequest (
    supplier_vir_number VARCHAR(100),
    supplier_id INT,
    supplier_name VARCHAR(255),
    supplier_address TEXT,
    part_id INT,
    part_name VARCHAR(255),
    material_control_level VARCHAR(100),
    material_description TEXT,
    material_location VARCHAR(100),
    status_of_part VARCHAR(50),
    cause TEXT,
    corrective_action_taken TEXT,
    technical_justification TEXT,
    date_posted DATE,
    date_resolved DATE,
    reported_by VARCHAR(255),
    signatures VARCHAR(255)
);


